import styled from 'styled-components';

export const Button = styled.button`
  margin: 10px;
  border:none;
  outline:none;
  width:200px;
  height:30px;
  background:#bbb;
  border-radius:5px;
  tran
  &:hover{
  background:#ccc;
  }
`;

export const NavUl = styled.ul`
  position: fixed;
  z-index:99;
  top: 0;
  display: flex;
  width: 100%;
  height: 30px;
  background:#3f3f3f6b;
  justify-content: center;
  align-items: center;
  margin:0;
  padding:10px 0;
`;
export const NavLi = styled.li`
  font-weight:bold;
  color:#333;
  list-style: none;
  margin: 0 10px;
  text-align: center;
`;

export const Input = styled.input``;

export const InputContainer = styled.div`
  height: 10px;
  display: flex;
  flex-direction: row-reverse;
  justify-content: center;
  align-items: center;
  transform: rotate(-90deg);
  position: absolute;
  right: 100px;
`;

export const Img = styled.img``;
